import React from "react";

import Card from "../UI/Card/Card";
import classes from "./SideBar.module.css";

const SideBar = () => {
  return (
    <Card className={classes.sidebar}>
      <ul>
        <li>Profile</li>
      </ul>
    </Card>
  );
};

export default SideBar;
